choices.text:
xmlIn = new WstxInputFactory();
xmlIn.setProperty(XMLInputFactory.IS_NAMESPACE_AWARE, true);
xmlIn.setProperty(XMLInputFactory.IS_COALESCING, true);
xmlIn.setProperty(XMLInputFactory.IS_REPLACING_ENTITY_REFERENCES, true);
xmlIn.setProperty(XMLInputFactory.IS_SUPPORTING_EXTERNAL_ENTITIES, false);

xmlIn = new WstxInputFactory();
xmlIn.setProperty(XMLInputFactory.IS_NAMESPACE_AWARE, Boolean.TRUE);
/* As per [WSTX-257], Woodstox specific feature:
 * 
 *   "Automatic support for xmlns attributes; if enabled, will
 *   automatically add namespace declarations when serializing
 *   elements (starting from root), if necessary. If disabled,
 *   will only output namespace declarations for explicitly
 *   bound namespaces. Note that this feature is enabled by
 *   default, for compatibility with non-Woodstox implementations."
 */
xmlIn.setProperty(WstxInputProperties.P_REPORT_PROLOG_WHITESPACE,
                  Boolean.FALSE);
// Also, let's pass the name of element to use for text contents:
if (_cfgNameForTextElement != null) {
    xmlIn.setProperty(WstxInputProperties.P_INPUT_PARSING_MODE,
                      WstxInputProperties.PARSING_MODE_DOCUMENT);
    xmlIn.setProperty(WstxInputProperties.P_INPUT_AS_TEXT_ELEMENT,
                      _cfgNameForTextElement);
}

